import React, {useState, useEffect} from 'react';


function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])


    return (
        <>
            <h1>Diagnosis results</h1>
            {
                (typeof data === "undefined") ? (
                    <p> Loading...</p>
                ):(

                    data.map((item) => {
                        console.log({item})
                        // <p> {item} </p>
                        return {item}
                    })

                )
            }
        </>
    );
}

export default Diagnose;
